const options = {
  draggable: true,
  showClose: false,
  autofocus: true,
  closeOnClickModal: false,
  closeOnPressEscape: false,
  dangerouslyUseHTMLString: true,
};
const confirmOptions = {
  draggable: true,
  showClose: false,
  autofocus: true,
  closeOnPressEscape: false,
  closeOnClickModal: false,
  cancelButtonClass: "btn-custom-cancel",
};
export { options, confirmOptions };
